  // }

  return (
    <div className="wrapper">
      <BrowserRouter>
      <header><h1>AllLearn</h1></header>

        <Routes>
          <Route path="/"><SignIn /></Route>
          <Route path="/homepage"><HomePage /></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
